ヴァセロンハーツ VACHERON HEARTS メッシュ長財布 ウォレット <br><br>ヴァセロンハーツのコントラストが美しいメッシュ長財布。<br>まるでチェスのマスのように編み込まれた表面は、美しいの一言です。<br>財布を開くと、札れはもちろんファスナー式小銭れと豊富なカードれがあり、<br>ビジネスやカジュアルでも使うことができる収納性を備えています。<br>メッシュデザインはシーズンと服を選ばないから、いつでもどこでも持ち歩けます。<br>プレゼントやギフトにもおすすめ。<br><img src="http://image.rakuten.co.jp/azumishoji/cabinet/00794510/05143740/imgrc0064256615.jpg" alt="" width="100%"><br>Item Information<br>サイズ（約）H19×W9×D2.8cm<br>仕様牛革（編みこみメッシュ）<br>札れ×1、ファスナー式小銭れ×1、カードれ×12、<br>ポケット×2、カラー：ブラック×ホワイト<br><img src="http://image.rakuten.co.jp/azumishoji/cabinet/00794510/05143740/imgrc0064256613.jpg" alt="" width="100%"><br><img src="http://image.rakuten.co.jp/azumishoji/cabinet/00794510/05143740/imgrc0064256614.jpg" alt="" width="100%"><br><img src="http://image.rakuten.co.jp/azumishoji/cabinet/00794510/05143740/imgrc0064256617.jpg" alt="" width="100%"><br><style type="text/css">
